package isSubsequence

import "testing"

func TestIsSubsequence(t *testing.T) {
	if !isSubsequence("abc", "ahbgdc") {
		t.Fatal("[*] TestIsSubsequence Error!")
	}
}

func TestIsSubsequence2(t *testing.T) {
	if isSubsequence("c", "b") {
		t.Fatal("[*] TestIsSubsequence2 Error!")
	}
}

func TestIsSubsequence3(t *testing.T) {
	if !isSubsequence("leeeeetcode", "") {
		t.Fatal("[*] TestIsSubsequence3 Error!")
	}
}

func TestIsSubsequence4(t *testing.T) {
	if isSubsequence("aaaaaa", "bbaaaa") {
		t.Fatal("[*] TestIsSubsequence4 Error!")
	}
}
